  CREATE OR REPLACE FUNCTION "FUNC1" (
   PRODUCT_ID IN NUMBER
)
RETURN VARCHAR2
IS
    PRODUCT_NAME VARCHAR2(100);
BEGIN
    EXECUTE IMMEDIATE
    'SELECT PRODUCT_NM
    FROM
    PRODUCT
    WHERE
    PRODUCT_ID = '||  PRODUCT_ID
    INTO PRODUCT_NM;
    RETURN PRODUCT_NM;
END;

